import './Expenses.css';
import ExpenseItem from './ExpenseItem';
function Expenses(props) {
  let items = [];
  let expensesArray = props.expenses;
  console.log('props:', props);
  for (let i = 0; i < expensesArray.length; i++) {
    items.push(<ExpenseItem date={expensesArray[i].date} name={expensesArray[i].name} price={expensesArray[i].price} />)
  }
  return (
    <div>
      {items}
    </div>
  )
}
export default Expenses;
